<script setup>import { ref, onMounted, onBeforeUnmount } from 'vue'
import L from 'leaflet'
import 'leaflet/dist/leaflet.css'

let map
const cidadeSelecionada = ref(null) 
const mapaAtual = ref('original') 
const mostrarmapa = ref(true)     

function mudarMapa(tipo) {
  mapaAtual.value = tipo
  console.log("Trocando para mapa:", tipo)
}

function abrirCidade(nome, info) {
  cidadeSelecionada.value = { nome, info }
 
}


function fecharCidade() {
  cidadeSelecionada.value = null

  setTimeout(() => { map.invalidateSize() }, 100)
}

onMounted(() => {
  map = L.map('map', {
    crs: L.CRS.Simple,
    minZoom: -2,
    maxZoom: 4,
    zoomControl: true
  })

  const width = 2593
  const height = 1589
  const bounds = [[0, 0], [height, width]]

  map.fitBounds(bounds)

  const svgElement = document.querySelector('.mapa-svg')

  // --- CORREÇÃO PRINCIPAL AQUI ---
  L.svgOverlay(svgElement, bounds, {
    interactive: true // ISSO PRECISA SER TRUE
  }).addTo(map)

  window.addEventListener('resize', handleResize)
})

function handleResize() {
  map && map.invalidateSize()
}

onBeforeUnmount(() => {
  window.removeEventListener('resize', handleResize)
  map && map.remove()
})
</script>

<template>
  <div class="container-geral">
<div 
      :id="mapaAtual !== 'original' ? 'quatro_opcoes' : 'opcoes'" 
      v-if="mostrarmapa"
      class="menu-flutuante"
    >
        <button v-if="mapaAtual !== 'municipios'" @click="mudarMapa('municipios')">Municípios</button>
        <button v-if="mapaAtual !== 'cursodagua'" @click="mudarMapa('cursodagua')">Curso D'água</button>
        <button v-if="mapaAtual !== 'barragem'"   @click="mudarMapa('barragem')">Barragem</button>
        <button v-if="mapaAtual !== 'original'"   @click="mudarMapa('original')">Bacia (Original)</button>
    </div>
    <div v-if="cidadeSelecionada" class="painel-detalhes">
    <h1>{{ cidadeSelecionada.nome }}</h1>
    <p>{{ cidadeSelecionada.info }}</p>
    
    <button class="btn-voltar" @click="fecharCidade">Voltar ao Mapa</button>
  </div>
    <div id="map" class="map-container"></div>
  <svg
      v-show="!cidadeSelecionada"
